from collections import deque

class Solution:
    def nearestExit(self, maze: list[list[str]], entrance: list[int]) -> int:
        q = deque[tuple[int,int]]([(entrance[0], entrance[1])])
        maze[entrance[0]][entrance[1]] = '+'
        def isExit(i, j):
            return i == 0 or i == len(maze) - 1 or j == 0 or j == len(maze[0]) - 1
        res = 0
        while q:
            res += 1
            for _ in range(len(q)):
                i, j = q.popleft()
                if isExit(i, j) and (i, j) != tuple(entrance):
                    return res - 1
                for di, dj in ((0, 1), (0, -1), (1, 0), (-1, 0)):
                    ni, nj = i + di, j + dj
                    if 0 <= ni < len(maze) and 0 <= nj < len(maze[0]) and maze[ni][nj] == '.':
                        q.append((ni, nj))
                        maze[ni][nj] = '+'
        return -1
